import React from 'react';
import { Link } from 'react-router-dom';
import './styles/Dashboard.css';

const Dashboard = () => {
    return (
        <div className="admin-container">
            <nav className="admin-navbar">
                <h2>Admin Panel</h2>
                <ul className="admin-nav-links">
                    <li><Link to="/admin/add-product">Add Product</Link></li>
                    <li><Link to="/admin/update-product">Update Product</Link></li>
                    <li><Link to="/admin/orders">All Orders</Link></li>
                    <li><Link to="/admin/update-order">Update Order</Link></li>
                    <li><Link to="/admin/messages">Messages</Link></li>
                </ul>
            </nav>

            <main className="admin-main">
                <h1>Welcome to the Admin Dashboard</h1>
                <p>Select an option from the navbar.</p>
            </main>

            <footer className="admin-footer">
                <p>Â© 2025 Admin Panel</p>
            </footer>
        </div>
    );
};

export default Dashboard;
